    public static final String kiadoImpesszum = "<p>A fordítást végezte és a szöveget gondozta Dr. Diós István.<br /><br />Az alkalmazás logója a Domitilla-katakomba (Róma) egyik keresztény sírköve (III. sz. vége) után készült. Az eredetileg pogány pásztorjelenetet a keresztények fölhasználták, hogy szimbolizálják azt a nyugalmat és boldogságot, ami az elhunyt lelkére az örök életben vár. Ez a kép kifejez néhány szempontot is, melyek ezt a katekizmust jellemzik: Krisztus, a Jó Pásztor az, aki vezeti és védi híveit (bárányait) tekintélyével (a pásztorbot), vonzza őket az igazság dallamos szimfóniájával (pásztorsíp) és pihenteti őket az „élet fája” árnyékában, és ez utóbbi a paradicsomot megnyitó, megváltó keresztje.<br /><br />A szentírási, kánonjogi és zsinati szövegek idézetei a Szent István Társulat által kiadott fordításokból származnak, ezek: Biblia (1994), Az egyházi törvénykönyv (1986), A II. Vatikáni Zsinat tanítása (1992).<br /><br />„Libreria Editrice Vaticana omnia sibi vindicat iura. Sine eiusdem licentia scripto data nemini liceat hunc Catechismum denuo imprimere aut in aliam linguam vertere.”<br /><br />Copyright, Latin alapszöveg (editio typica) 1997. – Libreria Editrice Vaticana, Cittŕ del Vaticano</p>";

